#[doc = " Host Power State"]
#[doc = "** Format: 'C`"]
#[doc = "*"]
#[doc = "* Describes the current power state of the host. This property is used"]
#[doc = "* by the host to inform the NCP when it has changed power states. The"]
#[doc = "* NCP can then use this state to determine which properties need"]
#[doc = "* asynchronous updates. Enumeration `spinel_host_power_state_t` defines"]
#[doc = "* the valid values (`SPINEL_HOST_POWER_STATE_*`):"]
#[doc = "*"]
#[doc = "*   `HOST_POWER_STATE_OFFLINE`: Host is physically powered off and"]
#[doc = "*   cannot be woken by the NCP. All asynchronous commands are"]
#[doc = "*   squelched."]
#[doc = "*"]
#[doc = "*   `HOST_POWER_STATE_DEEP_SLEEP`: The host is in a low power state"]
#[doc = "*   where it can be woken by the NCP but will potentially require more"]
#[doc = "*   than two seconds to become fully responsive. The NCP MUST"]
#[doc = "*   avoid sending unnecessary property updates, such as child table"]
#[doc = "*   updates or non-critical messages on the debug stream. If the NCP"]
#[doc = "*   needs to wake the host for traffic, the NCP MUST first take"]
#[doc = "*   action to wake the host. Once the NCP signals to the host that it"]
#[doc = "*   should wake up, the NCP MUST wait for some activity from the"]
#[doc = "*   host (indicating that it is fully awake) before sending frames."]
#[doc = "*"]
#[doc = "*   `HOST_POWER_STATE_RESERVED`:  This value MUST NOT be set by the host. If"]
#[doc = "*   received by the NCP, the NCP SHOULD consider this as a synonym"]
#[doc = "*   of `HOST_POWER_STATE_DEEP_SLEEP`."]
#[doc = "*"]
#[doc = "*   `HOST_POWER_STATE_LOW_POWER`: The host is in a low power state"]
#[doc = "*   where it can be immediately woken by the NCP. The NCP SHOULD"]
#[doc = "*   avoid sending unnecessary property updates, such as child table"]
#[doc = "*   updates or non-critical messages on the debug stream."]
#[doc = "*"]
#[doc = "*   `HOST_POWER_STATE_ONLINE`: The host is awake and responsive. No"]
#[doc = "*   special filtering is performed by the NCP on asynchronous updates."]
#[doc = "*"]
#[doc = "*   All other values are RESERVED. They MUST NOT be set by the"]
#[doc = "*   host. If received by the NCP, the NCP SHOULD consider the value as"]
#[doc = "*   a synonym of `HOST_POWER_STATE_LOW_POWER`."]
#[doc = "*"]
#[doc = "* After setting this power state, any further commands from the host to"]
#[doc = "* the NCP will cause `HOST_POWER_STATE` to automatically revert to"]
#[doc = "* `HOST_POWER_STATE_ONLINE`."]
#[doc = "*"]
