#[doc = "** Format: 'C`"]
#[doc = "*  Required capability: CAP_MCU_POWER_SAVE"]
#[doc = "*"]
#[doc = "* This property specifies the desired power state of NCP's micro-controller"]
#[doc = "* (MCU) when the underlying platform's operating system enters idle mode (i.e.,"]
#[doc = "* all active tasks/events are processed and the MCU can potentially enter a"]
#[doc = "* energy-saving power state)."]
#[doc = "*"]
#[doc = "* The power state primarily determines how the host should interact with the NCP"]
#[doc = "* and whether the host needs an external trigger (a \"poke\") to NCP before it can"]
#[doc = "* communicate with the NCP or not. After a reset, the MCU power state MUST be"]
#[doc = "* SPINEL_MCU_POWER_STATE_ON."]
#[doc = "*"]
#[doc = "* Enumeration `spinel_mcu_power_state_t` defines the valid values"]
#[doc = "* (`SPINEL_MCU_POWER_STATE_*` constants):"]
#[doc = "*"]
#[doc = "*   `SPINEL_MCU_POWER_STATE_ON`: NCP's MCU stays on and active all the time."]
#[doc = "*   When the NCP's desired power state is set to this value, host can send"]
#[doc = "*   messages to NCP without requiring any \"poke\" or external triggers. MCU is"]
#[doc = "*   expected to stay on and active. Note that the `ON` power state only"]
#[doc = "*   determines the MCU's power mode and is not related to radio's state."]
#[doc = "*"]
#[doc = "*   `SPINEL_MCU_POWER_STATE_LOW_POWER`: NCP's MCU can enter low-power"]
#[doc = "*   (energy-saving) state. When the NCP's desired power state is set to"]
#[doc = "*   `LOW_POWER`, host is expected to \"poke\" the NCP (e.g., an external trigger"]
#[doc = "*   like an interrupt) before it can communicate with the NCP (send a message"]
#[doc = "*   to the NCP). The \"poke\" mechanism is determined by the platform code (based"]
#[doc = "*   on NCP's interface to the host)."]
#[doc = "*   While power state is set to `LOW_POWER`, NCP can still (at any time) send"]
#[doc = "*   messages to host. Note that receiving a message from the NCP does NOT"]
#[doc = "*   indicate that the NCP's power state has changed, i.e., host is expected to"]
#[doc = "*   continue to \"poke\" NCP when it wants to talk to the NCP until the power"]
#[doc = "*   state is explicitly changed (by setting this property to `ON`)."]
#[doc = "*   Note that the `LOW_POWER` power state only determines the MCU's power mode"]
#[doc = "*   and is not related to radio's state."]
#[doc = "*"]
#[doc = "*   `SPINEL_MCU_POWER_STATE_OFF`: NCP is fully powered off."]
#[doc = "*   An NCP hardware reset (via a RESET pin) is required to bring the NCP back"]
#[doc = "*   to `SPINEL_MCU_POWER_STATE_ON`. RAM is not retained after reset."]
#[doc = "*"]
