#[doc = "*     logic level read from the pin."]
#[doc = "* *   `CMD_PROP_VALUE_SET`: The value of the associated bit is ignored"]
#[doc = "*     for these pins."]
#[doc = "*"]
#[doc = "* For GPIOs configured as outputs:"]
#[doc = "*"]
#[doc = "* *   `CMD_PROP_VAUE_GET`: The value of the associated bit is"]
#[doc = "*     implementation specific."]
#[doc = "* *   `CMD_PROP_VALUE_SET`: The value of the associated bit determines"]
#[doc = "*     the new logic level of the output. If this pin is configured as an"]
#[doc = "*     open-drain, setting the associated bit to 1 will cause the pin to"]
#[doc = "*     enter a Hi-Z state."]
