#[doc = " Raw Stream"]
#[doc = "** Format: `dD` (stream, read only)"]
#[doc = "*  Required Capability: SPINEL_CAP_MAC_RAW or SPINEL_CAP_CONFIG_RADIO"]
#[doc = "*"]
#[doc = "* This stream provides the capability of sending and receiving raw 15.4 frames"]
#[doc = "* to and from the radio. The exact format of the frame metadata and data is"]
#[doc = "* dependent on the MAC and PHY being used."]
#[doc = "*"]
#[doc = "* This property is a streaming property, meaning that you cannot explicitly"]
#[doc = "* fetch the value of this property. To receive traffic, you wait for"]
#[doc = "* `CMD_PROP_VALUE_IS` commands with this property id from the NCP."]
#[doc = "*"]
#[doc = "* The general format of this property is:"]
#[doc = "*"]
#[doc = "*    `d` : frame data"]
#[doc = "*    `D` : frame meta data"]
#[doc = "*"]
#[doc = "* The frame meta data is optional. Frame metadata MAY be empty or partially"]
#[doc = "* specified. Partially specified metadata MUST be accepted. Default values"]
#[doc = "* are used for all unspecified fields."]
#[doc = "*"]
#[doc = "* The frame metadata field consists of the following fields:"]
#[doc = "*"]
#[doc = "*   `c` : Received Signal Strength (RSSI) in dBm - default is -128"]
#[doc = "*   `c` : Noise floor in dBm - default is -128"]
#[doc = "*   `S` : Flags (see below)."]
#[doc = "*   `d` : PHY-specific data/struct"]
#[doc = "*   `d` : Vendor-specific data/struct"]
#[doc = "*"]
#[doc = "* Flags fields are defined by the following enumeration bitfields:"]
#[doc = "*"]
#[doc = "*   SPINEL_MD_FLAG_TX       = 0x0001 :  Packet was transmitted, not received."]
#[doc = "*   SPINEL_MD_FLAG_BAD_FCS  = 0x0004 :  Packet was received with bad FCS"]
#[doc = "*   SPINEL_MD_FLAG_DUPE     = 0x0008 :  Packet seems to be a duplicate"]
#[doc = "*   SPINEL_MD_FLAG_RESERVED = 0xFFF2 :  Flags reserved for future use."]
#[doc = "*"]
#[doc = "* The format of PHY-specific data for a Thread device contains the following"]
#[doc = "* optional fields:"]
#[doc = ""]
#[doc = "*   `C` : 802.15.4 channel (Receive channel)"]
#[doc = "*   `C` : IEEE 802.15.4 LQI"]
#[doc = "*   `L` : The timestamp milliseconds"]
#[doc = "*   `S` : The timestamp microseconds, offset to mMsec"]
#[doc = "*"]
#[doc = "* Frames written to this stream with `CMD_PROP_VALUE_SET` will be sent out"]
