#[doc = " Thread Joiner Commissioning command and the parameters"]
#[doc = "** Format `b` or `bU(UUUUU)` (fields in parenthesis are optional) - Write Only"]
#[doc = "*"]
#[doc = "* This property starts or stops Joiner's commissioning process"]
#[doc = "*"]
#[doc = "* Required capability: SPINEL_CAP_THREAD_JOINER"]
#[doc = "*"]
#[doc = "* Writing to this property starts/stops the Joiner commissioning process."]
#[doc = "* The immediate `VALUE_IS` response indicates success/failure of the starting/stopping"]
#[doc = "* the Joiner commissioning process."]
#[doc = "*"]
#[doc = "* After a successful start operation, the join process outcome is reported through an"]
#[doc = "* asynchronous `VALUE_IS(LAST_STATUS)` update with one of the following error status values:"]
#[doc = "*"]
#[doc = "*     - SPINEL_STATUS_JOIN_SUCCESS     the join process succeeded."]
#[doc = "*     - SPINEL_STATUS_JOIN_SECURITY    the join process failed due to security credentials."]
#[doc = "*     - SPINEL_STATUS_JOIN_NO_PEERS    no joinable network was discovered."]
#[doc = "*     - SPINEL_STATUS_JOIN_RSP_TIMEOUT if a response timed out."]
#[doc = "*     - SPINEL_STATUS_JOIN_FAILURE     join failure."]
#[doc = "*"]
#[doc = "* Frame format:"]
#[doc = "*"]
#[doc = "*  `b` : Start or stop commissioning process (true to start)."]
#[doc = "*"]
#[doc = "* Only if the start commissioning."]
#[doc = "*"]
#[doc = "*  `U` : Joiner's PSKd."]
#[doc = "*"]
#[doc = "* The next fields are all optional. If not provided, OpenThread default values would be used."]
#[doc = "*"]
#[doc = "*  `U` : Provisioning URL (use empty string if not required)."]
#[doc = "*  `U` : Vendor Name. If not specified or empty string, use OpenThread default (PACKAGE_NAME)."]
#[doc = "*  `U` : Vendor Model. If not specified or empty string, use OpenThread default (OPENTHREAD_CONFIG_PLATFORM_INFO)."]
#[doc = "*  `U` : Vendor Sw Version. If not specified or empty string, use OpenThread default (PACKAGE_VERSION)."]
#[doc = "*  `U` : Vendor Data String. Will not be appended if not specified."]
#[doc = "*"]
#[doc = "*/"]
