#[doc = "* Writing to this property triggers a request on `ChannelManager` to select a new channel."]
#[doc = "*"]
#[doc = "* Once a Channel Select is triggered, the Channel Manager will perform the following 3 steps:"]
#[doc = "*"]
#[doc = "* 1) `ChannelManager` decides if the channel change would be helpful. This check can be skipped if in the input"]
#[doc = "*    boolean to this property is set to `true` (skipping the quality check)."]
#[doc = "*    This step uses the collected link quality metrics on the device such as CCA failure rate, frame and message"]
#[doc = "*    error rates per neighbor, etc. to determine if the current channel quality is at the level that justifies"]
#[doc = "*    a channel change."]
#[doc = "*"]
